import './JoinSection.css';


const JoinSection = () => {
    return (
      <div className="join-section-wrapper">
        <div className="join-section-container">
          <h2>Ready to experience the future of cybersecurity?</h2>
          <p>Join the waitlist to get early access to Wreckbot and be among the first to experience its game-changing capabilities.</p>
        </div>
        <div className='hero-btns'>
      <button class="btn btn--curve">Join Waitlist</button>
      </div>
      </div>
    );
  }

  export default JoinSection;
